// 合法返回 1， 不合法返回 0 
inline bool C(int x) {
	// 是 7 的倍数 
	if (x % 7 == 0)	
		return 0;
	// 数字里含有 7 
	while(x) {
		if (x % 10 == 7)
			return 0;
		x /= 10;
	}
	return 1;
}
//  合法返回 1 ， 不合法返回 0 
inline bool check(ll x) {
	// check 本身 
	if (C(x) == 0)
		return 0;
	// check 因数 
	for (int i = 1; i < x; i++) {
		if (x % i == 0)	
			if (!C(i))
				return 0;
	}
	return 1;
}
inline void solve() {
	int n; scanf("%d", &n);
	if (n <= 2e5) {
		if (biao[n] == 0) {
			printf("-1\n");
			return;
		}
		n++;
		for (; ; n++) {
			if (biao[n] == 1) {
				printf("%d\n", n);
				return;
			}
		}
	} else {
		if(check(n) == 0) {
			printf("-1\n");
			return;
		}
		n++;
		for (; ; n++) {
			if (check(n) == 1) {
				printf("%d\n", n);
				return;
			}
		}
	}
}
inline void solve(int n) {
	printf(", %d", check(n));
}
